import React from "react";
import Slider from './slider/Slider';
import CatSlider from '../../Components/catslider/index';
import Banners from '../../Components/Banner/index';


const Home = () => {
    return(
        <>
        <Slider/>
        <CatSlider/>
        <Banners/>
        </>
    )
}
export default Home;
